import React, {useEffect } from "react";
import "./styles.css";
// import Typewriter from "./Typewriter";



export default function Home() {
    useEffect(() => {
        document.title = "Home";
      }, []);
    return (
        <div className = 'text'>
            <h2>Welcome to Charlie Yi's Website!</h2>

            <p>
              In the top left corner, you can find links to my LinkedIn, Github, and Resume.
            </p>
        </div>
    );
  }
